import React from 'react';
import './NavBar.scss';
import tags from '../../tags';

const NavBar = () => (
    <div className='nav-bar'>
        {
            tags.map(tag => 
                <Tag
                    key={k}
                 />)
        }
    </div>
)

export default NavBar;
